import React from 'react';

const Games = () => (
  <section id="games">
    <h2>Games</h2>
    <ol>
      <li>Capture The Flag</li>
      <li>Racing Game</li>
      <li>Trivia Quiz</li>
      <li>Survival Mode</li>
      <li>Card Battle</li>
      <li>Strategy War</li>
    </ol>
    <p>More games will be added soon! Stay tuned!</p>
  </section>
);

export default Games;
